syntax = "proto3";

package domain;

message ClientSupplyOrderDetail {
  string clientsupplyorderdetailid = 1;
  string clientsupplyorderid = 2;
  int32 clientsupplyid = 3;
  string supplyname = 4;
  string supplydescription = 5;
  string quantityordered = 6;
  int32 quantity = 7;
  string objectId = 8;
}
